    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE - ( + col0 ) * - + col1 NOT BETWEEN NULL AND - col0 + - - ( - - col1 );
  - name: tab2

outputs:
  - name: q11674.out
    data: |
      46	51	23
      64	77	40
      75	67	58
